// Hearthbeat GM - an general MIDI (subset) synth for heartbeat.js

var hb = window.hb || console.log('does not work without heartbeat.js');

hb.gm = {};

hb.gm.waveforms = {};
hb.gm.waveforms.akwf_piano_0001 = '';
hb.gm.waveforms.pir_zeman_stab2 = '';
hb.gm.waveforms.akwf_epiano_0014 = '';

hb.gm.generators = {
    metalik : function(n) {
        var sinfunc = hb.generators.sin;
        return hb.clamp(-0.9, ( sinfunc(n) + sinfunc(n * 6) ) / 2, 0.9); // ořezaná vícevlnka
    },
    organwave: function (n, p) {
        var sin = hb.generators.sin;
        var saw = hb.generators.saw;
        var parts = 6;
        if (p.boost) {
            parts = 0 + p.foot16 + p.foot8 + p.foot4 + p.foot2 + p.strings16 + p.strings4;
        }

        var out = 0;
        if (p.foot16) out += sin(n) / parts;
        if (p.foot8) out += sin(n * 2) / parts;
        if (p.foot4) out += sin(n * 4) / parts;
        if (p.foot2) out += sin(n * 8) / parts;

        if (p.strings16) out += saw(n) / parts;
        if (p.strings4) out += saw((n * 4) % 1 ) / parts;
        return out;
    }
};

function _base64ToArrayBuffer(base64) {
    var binary_string = window.atob(base64);
    var len = binary_string.length;
    var bytes = new Uint8Array(len);
    for (var i = 0; i < len; i++) {
        bytes[i] = binary_string.charCodeAt(i);
    }
    return bytes.buffer;
}

hb.gm.presets = {
    // piano
    1: { attack: 0.01, release: 0.1, reverb: 0.1, decay: 0.5, sustain: 0.05, generator: 'unpack', generator_params: 'akwf_piano_0001', filter: 4186, quack: true, baseNote: 62},
    // epiano
    5: { attack: 0.01, release: 0.5, reverb: 0.1, decay: 0.1, sustain: 0.3, generator: 'unpack', generator_params: 'akwf_epiano_0014', baseNote: 50 },
    // tubular bells
    15: { attack: 0.01, release: 0, reverb: 0, decay: 0.5, sustain: 0, generator: 'metalik', filter: 4186},
    // percussive organ
    18: { attack: 0.01, release: 0.05, reverb: 0.3, decay: 0.02, sustain: 0.6, generator: 'organwave', generator_params: {foot16: 1, foot8: 1, foot4: 1, foot2: 1, strings16:0, strings4: 1, boost: 1}},
    // church organ
    20: { attack: 0.01, release: 0.05, reverb: 0.3, decay: 0.01, sustain: 1, generator: 'organwave', generator_params: {foot16: 1, foot8: 1, foot4: 1, foot2: 1, strings16:0, strings4: 0, boost: 1}},
    // syn string
    51: { attack: 0.1, release: 0.5, reverb: 0, decay: 0.1, sustain: 0.8, generator: 'organwave', generator_params: {foot16: 0, foot8: 0, foot4: 0, foot2: 0, strings16:1, strings4: 1, boost: 1}, filter: 8372 },
    // orch hit
    56: { attack: 0.01, release: 0, reverb: 0, decay: 0.3, sustain: 0, generator: 'unpack', generator_params: 'pir_zeman_stab2', once: true },
    // flute
    74: { attack: 0.05, release: 0.3, reverb: 0.05, decay: 0.05, sustain: 0.9, generator: 'sqr', filter: 800, quack: true},
    // square lead
    81: { attack: 0.05, release: 0.3, reverb: 0, decay: 0.05, sustain: 0.9, generator: 'sqr'},
    // saw lead
    82: { attack: 0.05, release: 0.3, reverb: 0, decay: 0.05, sustain: 0.9, generator: 'saw'},
    fallback: { generator: 'triangle' }
};

hb.gm.synth = function() {
    var me = {};

    // public params
    me.attack = 0.01;
    me.release = 0.5;
    me.eq_low = 0;
    me.eq_hi = 0;
    me.chorus = 0;
    me.reverb = 0;
    me.volume = 1;

    // patch (internal) params
    me.decay = 0.01;
    me.sustain = 0.8;
    me.generator = 'triangle';
    me.generator_params = {};
    me.once = false;
    me.baseNote = 60;
    me.filter = 22000;
    me.quack = false;

    me.buffer = hb.ac.createBuffer(1, hb.ac.sampleRate * 1, hb.ac.sampleRate);

    me._ac = hb.ac;

    me._mixer = hb.MixStrip();
    me._mixer.param('vol', 0.3);
    me.output = me._mixer.output;

    // me._notes = [];
    me._voices = {};

    me.param = function(name, val) {
        if (name=='release' && me.sustain==0) {
            name = 'decay';
        }
        me[name] = val;
        if (name=='reverb') me._mixer.param('reverb', val);
        if (name=='eq_hi') me._mixer.param('hi', val);
        if (name=='eq_low') me._mixer.param('mid', val);
    };

    me.programChange = function(no) {
        var program = hb.gm.presets[no] || hb.gm.presets.fallback;

        me.attack = program.attack || 0.01;
        me.release = program.release || 0.5;
        me.eq_low = program.eq_low || 0;
        me.eq_hi = program.eq_hi || 0;
        me.chorus = program.chorus || 0;
        me.reverb = program.reverb || 0;
        //me.volume = programvolume || 1;

        // patch (internal) params
        me.decay = program.decay || 0.01;
        me.sustain = program.sustain;
        me.generator = program.generator || 'triangle';
        me.generator_params = program.generator_params || {};
        me.once = program.once || 0;
        me.baseNote = program.baseNote || 60;
        me.filter = program.filter || 22000;
        me.quack = program.quack || false;

        me._mixer.param('reverb', me.reverb);
        me._mixer.param('hi', me.eq_hi);
        me._mixer.param('low', me.eq_low);

        if (me.generator=='unpack') {
            hb.ac.decodeAudioData(_base64ToArrayBuffer(hb.gm.waveforms[me.generator_params]), function (buffer) {
                me.buffer = buffer;
            });
        } else {
            me.buffer = hb.generateWaveformBuffer(hb.gm.generators[me.generator] || hb.generators[me.generator], me.generator_params);
        }
    };

    me._getEnv = function(max) {
        // TODO - velocity
        return {
            max: max,
            attack: me.attack,
            decay: me.decay,
            sustain: me.sustain,
            release: me.release
        };
    };

    me._getFEnv = function() {
        return {
            max: me.filter,
            attack: me.attack,
            decay: me.decay,
            sustain: me.filter * me.sustain,
            release: me.release
        };
    };

    me._makeVoice = function(nn, vel) {
        var ac = hb.ac;
        var freq = hb.midi2cps(nn);
        var vox = {};
        vox._osc = me.once ? hb.makeSamplerOsc(me.buffer, freq, hb.midi2cps(me.baseNote)) : hb.makeSamplerLoopOsc(me.buffer, freq, hb.midi2cps(me.baseNote));
        vox._filter = hb.makeFilter('lowpass', me.filter);
        vox._env = hb.makeGain();

        vox._osc.connect(vox._filter);
        vox._filter.connect(vox._env);

        hb.adsrStart(vox._env.gain, me._getEnv(1));
        if (me.quack) {
            vox._filter.frequency.setValueAtTime(0, hb.ac.currentTime);
            hb.adsrStart(vox._filter.frequency, me._getFEnv());
        } else {
            vox._filter.frequency.setValueAtTime(me.filter, hb.ac.currentTime);
        }

        vox._env.connect(me._mixer.input);

        vox.noteOff = function () {
            var env = me._getEnv(1);
            hb.adsrStop(vox._env.gain, env);
            if (me.quack) {
                hb.adsrStop(vox._filter.frequency, me._getFEnv());
            }

            vox._osc.stop(hb.ac.currentTime + env.release);
            // TODO - GC
        };

        return vox;
    };

    me.noteOn = function(nn, vel) {
        // console.log('on ' + nn);
        if (me._voices[nn]) return; // už je
        me._voices[nn] = me._makeVoice(nn, vel);
    };

    me.noteOff = function(nn) {
        // console.log('off ' + nn);
        if (!me._voices[nn]) return; // už není
        me._voices[nn].noteOff();
        delete me._voices[nn];
    };


    me.panic = function() {
        console.log('PANIC at the disco!');
        for (var nn in me._voices) {
            hb.setNow(me._voices[nn]._env.gain, 0);
            me._voices[nn]._osc.stop(hb.now());
            delete me._voices[nn];
        }
        // me._vol.gain.setValueAtTime(0, me._ac.currentTime);
    };

    me.programChange(1);

    return me;
};
